css:
@-moz-document url-prefix("https://androidpc.es") {
span { 
    color: #fff;
}

strong {
    color: inherit;
}

.single .main-wrap {
    background-color: #000;
}

.the-post .the-post-header .post-title {
    color: #ffffff;
}

.post-content .textwidget {
    color: #fff;
    background-color: #000;
}

.entry-content {
    color: #fff;
    background-color: #000;
}


.post-title-alt a, .post-title a {
    color: #6ac4f3;
}

#wpcomm .wc-comment-right .wc-comment-text p {
    background-color: #000;
}

#wpcomm .wc-comment-header {
    background-color: #000;
}

#wpcomm .wc-comment-footer {
    color: #fff;
    background-color: #000;
}

#wpcomm .wc-reply .wc-comment-label span {
    color: white;
    background-color: #000;
}

#wpcomm .wc-comment-right .wc-comment-text {
    background-color: #000;
    color: white;
}

#wpcomm .wc-reply .wc-comment-right {
    background: #000000;
}

#wpcomm .wc-comment .wc-comment-right {
    background: #000000;
}

#wpcomm .wc-comment .wc-comment-left .wc-comment-label {
    background: #000;
}

h1, h2,h3,h4,h4,h6 {
    color: white
}

.lower-footer {
    color: #ffffff;
    background-color: black;
}

#wpcomm .wpdiscuz-front-actions {
    background: #000000;
}

#wpcomm .wc_comm_form.wc_main_comm_form .wc-field-textarea .wpdiscuz-textarea-wrap textarea {
    background-color: black;
}

.main-wrap {
    background-color: #000;
}

.post-content .textwidget {
    background-color: black;
    color: white;
}

.post-content>:first-child, .textwidget>:first-child {
    color: white;
}

.grid-post .post-content {
    background-color: black;
}

.post-excerpt p>a {
    color: #ffffff !important;
}

.social-share a, .social-icons a {
    color: #ffffff;
}

.main-head {
    border-bottom: 1px solid #000000;
}

.post-content li, .textwidget li {
    background-color: black;
}

tr:nth-child(odd) td {
    background: #000000;
}

div#ez-toc-container p.ez-toc-title {
    background-color: black;
    color: white;
}

#ez-toc-container.counter-flat ul, #ez-toc-container.counter-hierarchy ul, .ez-toc-widget-container.counter-flat ul, .ez-toc-widget-container.counter-hierarchy ul {
    background-color: black;
}

.post-content, th, td {
    background: #000;
}

.post-content a {
    color: #8dd8ff !important;
}

.navigation .menu>li>a, .navigation.inline .menu>li>a {
    color: black !important;
}


#review-statistics .review-wrap-up .review-wu-right ul li, #review-statistics .review-wu-bars h3, .review-wu-bars span, #review-statistics .review-wrap-up .cwpr-review-top .cwp-item-category a {
    color: #ffffff;
}

.archive-head {
    background-color: black;
}

#wpcomm a {
    color: #8dd8ff;
}

.main-pagination.number .page-numbers, .main-pagination.number a {
    color: #8dd8ff;
}

.notification-dialog {
    background: #3f4850;
}

.cwp-popular-review .wppr-col {
    color: white;
}

.widgets-list-layout a {
    color: white;
}

.widget-posts .post-title {
    color: white;
}


.entry-content p {
    color: white;
}

.media-menu .active, .media-menu .active:hover {
    color: #ffffff;
}

.media-menu .media-menu-item {
    color: #7accf4;
}

.attachments-browser .instructions {
    color: #ccc;
}

.ui-accordion .ui-accordion-header {
    background: black;
}

label.wppr-upsell-label {
    background: #2b4a61;
}

.wppr-review-options-list label {
    background: #706c6c;
}

.main-pagination .next a, .main-pagination .previous a {
    color: white;
}

.post-title-alt a:hover, .post-title a:hover {
    color: #c4f5ff;
    opacity: 1;
    text-shadow: none;
    box-shadow: none;
}
}
